paper.project.layers[0].removeChildren();
var p    = new paper.Path(),
    size = view.getSize(),
    density   = 400,   steps     = 382,
    x_scale   = 3,     thickness = .2,
    y_scale   = 6.2,   hack_y;

_.extend( p, { 
  fullySelected: 1,  strokeColor: 'black',  strokeWidth: scale(thickness) 
});

var land_ahoy = _.once(function (ry) { 
  p.add( new Point( -1, scale(ry) ) );
});

for (var x = -0.999, step = 1/steps; x < 0.99; x += step) {   if (step <= 0) return;
  var y = Math.pow( 4.0 - x * x, 0.1 ) *
      ( Math.sqrt(Math.cos( 1.7*x )) * Math.cos( density*x ) + Math.sqrt(Math.abs(x) ) ),
      real_x = size.width/2  + size.width/x_scale  * x,
      real_y = size.height/2 - size.height/y_scale * y;

  if (y) {
    land_ahoy(real_y);
    hack_y = real_y;
  }
  p.add( new Point( scale(real_x), scale(real_y) ) );
}

p.add( new Point( size.width, scale(hack_y) ) );
